import Navbar from './Components/Navbar';
import About from "./Components/About";
import Login from "./Components/login";
import Profile from "./Components/Profile";
import Dalle from "./Components/Dalle";
import Neural from "./Components/Neural";
import Dream from "./Components/Dream";
import { useState } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
function App() {
  const [login, setlogin] = useState(false);
  const [username, setUsername] = useState("");
  const userid = (name) => {
    setUsername(name);
  }
  const handleLogin = () => {
    setlogin(true);
  }
  const handleLogout = () => {
    window.location.reloa();
    setlogin(false);
  }
  return (
    <>
      <BrowserRouter>
        {login && <Navbar handleLogout={handleLogout} />}
        <Routes>
          {login ?
            <>
              <Route exact path='/' element={<About />} />
              <Route exact path='/Generation' element={<Dalle />} />
              <Route exact path='/Creativity' element={<Neural />} />
              <Route exact path='/Dreaming' element={<Dream />} />
              <Route exact path='/Profile' element={<Profile user={username} loggedout={handleLogout} />} />
            </>
            :
            <Route exact path='*' element={<Login handleLogin={handleLogin} userid={userid} />} />
          }
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
